    }

    //// Generated Images

    public class func imageOfSkipChoice(#filled: Bool) -> UIImage {
        UIGraphicsBeginImageContextWithOptions(CGSizeMake(283, 318), false, 0)
            StyleKit.drawSkipChoice(filled: filled)

        let imageOfSkipChoice = UIGraphicsGetImageFromCurrentImageContext()!
        UIGraphicsEndImageContext()

        return imageOfSkipChoice
    }

    public class func imageOfMarryChoice(#filled: Bool) -> UIImage {
        UIGraphicsBeginImageContextWithOptions(CGSizeMake(283, 318), false, 0)
            StyleKit.drawMarryChoice(filled: filled)

        let imageOfMarryChoice = UIGraphicsGetImageFromCurrentImageContext()!
        UIGraphicsEndImageContext()

        return imageOfMarryChoice
    }

    public class var imageOfChatBubble: UIImage {
        if Cache.imageOfChatBubble != nil {
            return Cache.imageOfChatBubble!
        }

        UIGraphicsBeginImageContextWithOptions(CGSizeMake(48, 35), false, 0)
            StyleKit.drawChatBubble()

        Cache.imageOfChatBubble = UIGraphicsGetImageFromCurrentImageContext()!.resizableImageWithCapInsets(UIEdgeInsetsMake(24, 19, 10, 28), resizingMode: UIImageResizingMode.Stretch)
        UIGraphicsEndImageContext()

        return Cache.imageOfChatBubble!
    }

    //// Customization Infrastructure

    @IBOutlet var chatBubbleTargets: [AnyObject]! {
        get { return Cache.chatBubbleTargets }
        set {
            Cache.chatBubbleTargets = newValue
            for target: AnyObject in newValue {
                target.setImage(StyleKit.imageOfChatBubble)
            }
        }
    }

